sympy.sympy.polys.fields.is_element:
def is_element(self, element):
    """True if ``element`` is an element of this field. False otherwise. """
    return isinstance(element, FracElement) and element.field == self

sympy.sympy.polys.fields._extract_ground:
def _extract_ground(self, element):
    domain = self.field.domain

    try:
        element = domain.convert(element)
    except CoercionFailed:
        if not domain.is_Field and domain.has_assoc_Field:
            ground_field = domain.get_field()

            try:
                element = ground_field.convert(element)
            except CoercionFailed:
                pass
            else:
                return -1, ground_field.numer(element), ground_field.denom(element)

        return 0, None, None
    else:
        return 1, element, None

sympy.sympy.polys.fields.__rtruediv__:
def __rtruediv__(f, c):
    if not f:
        raise ZeroDivisionError
    elif f.field.ring.is_element(c):
        return f.new(f.denom*c, f.numer)

    op, g_numer, g_denom = f._extract_ground(c)

    if op == 1:
        return f.new(f.denom*g_numer, f.numer)
    elif not op:
        return NotImplemented
    else:
        return f.new(f.denom*g_numer, f.numer*g_denom)

sympy.sympy.polys.rings.is_element:
def is_element(self, element) -> TypeIs[PolyElement[Er]]:
    """Check if element belongs to this ring."""
    return isinstance(element, PolyElement) and element.ring == self

sympy.sympy.polys.rings.__mul__:
def __mul__(
    self, other: PolyElement[Er] | Er | int | PolyElement[PolyElement[Er]], /
) -> PolyElement[Er] | PolyElement[PolyElement[Er]]:
    """Multiply two polynomials.

    Examples
    ========

    >>> from sympy.polys.domains import QQ
    >>> from sympy.polys.rings import ring

    >>> _, x, y = ring('x, y', QQ)
    >>> p1 = x + y
    >>> p2 = x - y
    >>> p1*p2
    x**2 - y**2

    """
    if not self or not other:
        return self.ring.zero

    if self.ring.is_element(other):
        return self._mul(other)

    if isinstance(other, PolyElement):
        domain = other.ring.domain
        if isinstance(domain, PolynomialRing) and domain.ring.is_element(self):
            return cast("PolyElement[PolyElement[Er]]", other).mul_ground(self)

    res = self._try_mul_ground(other)
    if res is not NotImplemented:
        return res

    if isinstance(other, PolyElement):
        return other._try_mul_ground(self)

    return NotImplemented
